import React from "react";

const HomeIssues = () => {
  return (
    <div className="flex issuesDiv">
        <div>
            <input type="checkbox" style={{margin: "15px"}} />
            <i class="far fa-scrubber icons issueIcon" ></i>
        </div>
        <div>
            <div class="flex issueDetails">
                <a class="issueName" href="/issues">#1</a>
                <p className="issueLabel" style={{background: 'red', color: '#fff'}}>bug</p>
            </div>
        </div>
    </div>
  );
};

export default HomeIssues;
